import React from "react";

export default function TextFrom(props) {
  return (
    <div>
      <h1>{props.heading}</h1>
      <div className="mb-3">
        <label for="mybox" className="form-label">
          {props.textarea}
        </label>
      </div>
    </div>
  );
}
TextFrom.prototype = {
  heading: PropTypes.string.isRequired,
};
TextFrom.defaultProps = {
  heading: "textarea",
};
